import React from 'react';
import Logo from '../../Assets/mint.svg';
import HomeIcon from '@material-ui/icons/Home';
import FeaturedPlaylistOutlinedIcon from '@material-ui/icons/FeaturedPlayListOutlined';
import AssignmentTurnedInOutlinedIcon from '@material-ui/icons/AssignmentTurnedInOutlined';
import PeopleAltOutlinedIcon from '@material-ui/icons/PeopleAltOutlined';
import NotificationsOutlinedIcon from '@material-ui/icons/NotificationsOutlined';
import Search from '@material-ui/icons/Search';
import Avatar from '@material-ui/core/Avatar';
import Button from '../Button';
import styles from './SideBar.module.css';

function SideBar() {
    return (
        <div className='mHeader'>
            <div className='mHeader-content'>
                <div className='mHeader-logo'>
                    <img
                        src={Logo} alt="logo" />
                    <div className='mHeader_icons'>
                        <div className='mHeader_icon'><HomeIcon /></div>
                        <div className='mHeader_icon'><FeaturedPlaylistOutlinedIcon /></div>
                        <div className='mHeader_icon'><AssignmentTurnedInOutlinedIcon /></div>
                        <div className='mHeader_icon'><PeopleAltOutlinedIcon /></div>
                        <div className='mHeader_icon'><NotificationsOutlinedIcon /></div>
                    </div>
                    <div className='mHeader_input'>
                        <Search />
                        <input type="text" placeholder='Search Questions' />
                    </div>
                    <div className='mHeader_rem'>
                        <Avatar />
                    </div>
                    <Button>Add Question</Button>
                </div>
            </div>
        </div>
    )
}

export default SideBar
